import { Link, useParams } from "react-router-dom";
import jsPDF from "jspdf";
import { useEffect, useState } from "react";
import axios from "axios";

const PaymentSuccess = () => {
    const { tran_id } = useParams();
    const [orderDetails, setOrderDetails] = useState(null);

    useEffect(() => {
        // Fetch the order details using the transaction ID from the backend
        axios.get(`http://localhost:5000/order/${tran_id}`)
            .then(response => {
                setOrderDetails(response.data);
            })
            .catch(error => {
                console.error("Error fetching order details:", error);
            });
    }, [tran_id]);

    const downloadInvoice = () => {
        const doc = new jsPDF();

        // Adding Logo
        const logoImg = "data:image/png;base64,";

        const imgWidth = 20; // Set image width to 100px
        const imgHeight = 20; // Set image height to 100px

        // Calculate x position for centering
        const xOffset = (doc.internal.pageSize.getWidth() - imgWidth) / 2;
        doc.addImage(logoImg, "PNG", xOffset, 10, imgWidth, imgHeight);

        // Adding Invoice Title
        doc.setFontSize(20);
        doc.text("BRTC Bus Service", 105, 40, null, null, "center");

        if (orderDetails) {
            // Adding transaction ID
            doc.setFontSize(12);
            
            // Adding user details
            doc.text(`Name: ${orderDetails.name}`, 20, 70);
            doc.text(`Price: ${orderDetails.price}`, 20, 70);
            doc.text(`Bus Name: ${orderDetails.busName}`, 20, 70);
            doc.text(`Referance: ${orderDetails.counterMaster}`, 20, 70);
            doc.text(`Email: ${orderDetails.email}`, 20, 80);
            doc.text(`Phone: ${orderDetails.phone}`, 20, 90);
            doc.text(`Address: ${orderDetails.address}`, 20, 100);
            doc.text(`Counter Location: ${orderDetails.location}`, 20, 110);

            doc.text(`Transaction ID: ${tran_id}`, 20, 60);
            doc.text(`Allocated Seat(s): ${orderDetails.allocatedSeat.join(", ")}`, 20, 120);
            const now = new Date();
            const timestamp = now.toLocaleString();
            doc.text(`Download Time: ${timestamp}`, 20, 50);

            // Save the PDF
            doc.save("invoice.pdf");
        } else {
            alert("Unable to generate invoice. Please try again.");
        }
    };

    return (
        <div className="px-8 lg:px-0 mt-40 max-w-[1320px] mx-auto">
            <div className="bg-[#FF4E25] mx-auto max-w-[868px] px-5 md:px-[150px] lg:px-[250px] py-20 md:py-[100px] lg:py-[150px] rounded bg-opacity-10">
                <p className="auth-heading">Your Payment Successfully Done</p>
                <p className="mt-5 text-xl text-green-700 text-center">Your transaction ID: {tran_id}</p>

                <button className="mt-10 button w-full" onClick={downloadInvoice}>
                    Download Invoice
                </button>

                <Link to='/'><button className="mt-10 button w-full">Continue</button></Link>
            </div>
        </div>
    );
};

export default PaymentSuccess;
